#つぶやきProcessing 「色雲海の薔薇」

f=0
draw=_=&gt;{
f||createCanvas(500,500)
background(0)
noStroke()
colorMode(HSB,8);
for(r=0;r&lt;500;r+=50)
for(i=I=f*(noise(r)-.5)/9;i&lt;TAU-.1+I;i+=PI/6){
fill((i-I)/PI*4,8,8,6);
arc(250+r*cos(i),250+r*sin(i),r*2/3,r*2/3,i+TAU/3,i-TAU/3)
}
f++
} https://t.co/2jse8Iar9V

